import Vue from "vue"
import vueRouter from "vue-router"

Vue.use(vueRouter)

import Home from "../views/Home/Home.vue"

const router = new vueRouter({
    routes:[
        {
            path:"/",
            redirect:"/home"
        },{
            path:"/home",
            component:Home
        },{
            path:"/user",
            component:()=>import("../views/User/User.vue")
        }
        
    ]
})

export default router
